import React from "react";
import { Link } from "react-router-dom";

const CarLocation = () => {
  return (
    <div>
      <h1>Car Location</h1>
      <h2>FOUND A PAGE</h2>
      <Link to="/campsite">Return</Link>
    </div>
  );
};

export default CarLocation;
